import { Component } from "react";
import Link from 'next/link'
import MainLayout from "../component/MyLayout";
import fetch from 'isomorphic-unfetch';


const PostLink = props => {
    return (
        <li>
            <Link href={`/post?title=${props.title}`}>
                <a>{props.title}</a>
            </Link>
        </li>
    )
}
function Index (props) {
    return (
        <div>
            <MainLayout>
            <p>Vel Thunai</p>
            <ul>
                <PostLink title="Libra Tech Doc"/>
                <PostLink title="Libra Admin Doc"/>
                <PostLink title="Libra Project Doc"/>
            </ul>
            <div>
                <h1>TV Shows</h1>\
                <ul>
                {
                    props.show.map((show,index) => {
                        return (
                        <li key={index}>{show.name}</li>
                        )
                    })
                }
                </ul>
            </div>
            </MainLayout>
        </div>
    )
}

export default Index;
